function run(inputDepth) {
    console.clear()

    var firstWord;
    var secondWord;
    var n = 0;

    // set the current language
    setSource(document.getElementById("languageSelect").value)

    // detect the current depth value
    if(inputDepth != null) {
        pDepth = inputDepth;
    } else {
        pDepth = parseInt(document.getElementById("d").value);
    }

    if(!pDepth) {
        pDepth = 2;
    }

    if(!parseInt(document.getElementById("d").value)) {
        console.log("Starting Depth: " + pDepth + " (2)");
    } else {
        console.log("Starting Depth: " + pDepth + " (" + parseInt(document.getElementById("d").value) + ")");
    }

    // generate random 2 letter starting point
    while(n == 0) {
        firstWord = getRand(source);
        secondWord = getRand(source);
        if(getAllWordsWithPattern(firstWord[0] + secondWord[1], 0).length > 5) {
            n = 1;
        } else if(getAllWordsWithPattern(firstWord[0] + firstWord[1], 0).length > 5) {
            n = 1;
            secondWord = firstWord;
        }
    }
    
    console.log("finished selection")

    // Start the text with the first `depth` letters of the random word
    text = firstWord[0] + secondWord[1];
    console.log("Initial words:", firstWord, ", ", secondWord, "| Starting text:", text);

    // generate letters
    for (let j = 0; j < 100; j++) {
        if(text.length < pDepth) {
            depth = text.length;
        } else {
            depth = pDepth;
        }
        
        console.log("depth: " + depth);
        // get the last `depth` letters of the current text
        let lastNLetters = text.slice(-depth);
        console.log(`Iteration ${j}: Last ${depth} letters = '${lastNLetters}'`);

        // find all words matching the last `depth` letters
        let possibleWords = getAllWordsWithPattern(lastNLetters, text.length - depth);

        if (!possibleWords || possibleWords.length === 0) {
            console.log("No possible words found.");
            break;
        }

        let selectedWord = getRand(possibleWords);
        console.log("Selected word:", selectedWord);

        if (text.length >= selectedWord.length) {
            console.log("Word too short:", selectedWord);
            break;
        }

        // append the next letter in the selected word to 'text'
        let nextLetter = selectedWord[text.length];
        if (!nextLetter) {
            console.log("No next letter available.");
            break;
        }

        text += nextLetter;
    }

    if(getAllWordsWithPattern(text.slice(0,text.length - 2), 0).length > 0) {
        if(pDepth > 3) {
            run(pDepth - 1)
        } else {
            run()
        }
    } else {
        console.log("Final text:", text);
        display.textContent = text[0].toUpperCase() + text.slice(1,text.length);
    }
}

function getAllWordsWithPattern(pattern, startIndex) {
    console.log(`Finding words with '${pattern}' starting from index ${startIndex}`);

    // filter words that contain the depth pattern at the specified index
    let result = source.filter(word => {
        if (startIndex + pattern.length > word.length) {
            return false;
        }
        if (word.slice(startIndex, startIndex + pattern.length) === pattern) {
            return true;
        }
        return false;
    });

    console.log(result)

    return result;
}

function rand(length) {
    return Math.floor(Math.random() * length);
}

function getRand(list) {
    return list[rand(list.length)];
}

// match strings to databases
function setSource(string) {
    if(string == "en") {
        source = english;
    }
    if(string == "es") {
        source = spanish;
    }
    if(string == "fr") {
        source = french;
    }
    if(string == "de") {
        source = german;
    }
    if(string == "tr") {
        source = turkish;
    }
    if(string == "no") {
        source = norwegian;
    }
    if(string == "ic") {
        source = icelandic;
    }
    if(string == "ru") {
        source = russian;
    }
    if(string == "n") {
        source = names;
    }
}

